import React from "react";
import ReactDOM from "react-dom";

import SeasonDisplay from "./SeasonDisplay";


const App = () => {
  window.navigator.geolocation.getCurrentPosition(
    (position) => console.log(position),
    (err) => console.log(err)
  );
  return(
    <SeasonDisplay />
  );
};


ReactDOM.render(
  <App />, document.querySelector('#root')
);
